import React, {memo} from "react";

const Footer = memo(props =>{
    const FilterButtons = [{
        title: "All",
        isActived: true,
        onClick: () => {}
    }]
    return (
        <footer className="footer">
            <span className="todo-count">
                <strong>2</strong>
                <span></span>
                <span>items</span>
                <span>left</span>
            </span>
            <ul className="filters">
                <FilterButton/>
                <FilterButton/>
                <FilterButton/>
            </ul>
        </footer>
    )
})

const FilterButton = memo(props =>{
    return (
        <>
            <li>
                <a
                    href="#/"
                    className={"selected"}
                    onClick={() =>{}}
                >
                    ALL
                </a>
            </li>
        </>
    )
}

)
export default Footer
